import React from 'react';
import {AiFillMessage} from "react-icons/ai";

const _styleAiFillMessage = {
    iconAiFillMessage:{
        width: '35px',
        height: '35px',
        borderRadius: '33px',
        color: '#767676',
        cursor: 'pointer',
    },
};

function PinMessageUser() {
    return (
        <div style={_styleAiFillMessage.iconAiFillMessage}>
            <AiFillMessage />
        </div>
    )
}

export default PinMessageUser
